import { AdminComponent } from './admin.component';
export const ADMIN_ROUTES = [{
  path: '',
  component: AdminComponent,
  children: [{
    path: '',
    redirectTo: 'dashboard',
    pathMatch: 'full'
  }, {
    path: 'dashboard',
    loadComponent: () => import('./components/dashboard/dashboard.component').then(c => c.DashboardComponent)
  }, {
    path: 'settings',
    loadComponent: () => import('./components/settings/settings.component').then(c => c.SettingsComponent)
  }, {
    path: 'tables',
    loadComponent: () => import('./components/tables/tables.component').then(c => c.TablesComponent)
  }, {
    path: 'maps',
    loadComponent: () => import('./components/maps/maps.component').then(c => c.MapsComponent)
  }]
}];
